import React from 'react';
import { Route, Switch } from 'react-router-dom'
import LandingPage from './LandingPage';
import LogIn from './LogIn'

class App extends React.Component {
  render() {
    return (
      <main className='App'>
        <Switch>
          <Route exact path="/" component={LandingPage}/>

        </Switch>
      </main>
    );

  }

}

export default App;
